window.bookSummaryJSON = "<p>When the mighty and cruel must be brought low, it's the killers and the schemers who emerge from the shadows. As plans twist and change, and our protagonists are foiled and beaten, one thing remains true: no matter the cost, the king must fall.</p> <p><i>The King Must Fall</i> is a dark fantasy anthology featuring 19 titans of the dark and grimdark fantasy genres writing about rogues, assassins, mages, blackguards, and warriors on quests to kill their kings, rulers, captains, and leaders.</p> <p>Featuring stories by Devin Madson, Luke Scull, Anna Smith Spark, Anthony Ryan, Michael R Fletcher, Jeremy Szal, Lee Murray, Daniel Polansky, Shawn Speakman, Adrian Tchaikovsky, Trudi Canavan, Alex Marshall, Anna Stephens, Justin Call, Peter Orullian, Kameron Hurley, Matthew Ward, Deborah A. Wolf, and Bradley P. Beaulieu.</p>"; 
